import React from 'react'

function ToDo({todo, onDelete}) {
  return (
     <div>
      <h4>{todo.title}</h4>
      <p>{todo.des}</p>
      <button onClick={onDelete}>Delete</button>
     </div>
  )
}

export default ToDo
